  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144247 includes Surface
  underway data collected from ATLANTIS in the Caribbean Sea and North Atlantic Ocean
  from 2012-03-24 to 2012-04-17. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE
  (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE, Partial pressure (or fugacity)
  of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide
  - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
  data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Rik
  Wanninkhof and Robert Castle of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological
  Laboratory as part of the CLIVAR_A22_2012_UW data set. CDIAC associated the following
  cruise ID(s) with this data set: 33AT20120324nnThe International CLIVAR Global Ocean
  Carbon and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"license_title\":
